import { Component } from '@angular/core';
import { RouterOutlet } from '@angular/router';

@Component({
  selector: 'app-root',
  standalone: true,
  imports: [RouterOutlet],
  template: `
    <h1>Welcome to Gearify!</h1>
    <router-outlet></router-outlet>
  `,
  styles: [`
    h1 {
      color: #333;
      text-align: center;
      padding: 2rem;
    }
  `]
})
export class AppComponent {
  title = 'gearify-web';
}
